import React from 'react';
import PropTypes from "prop-types";
import { withStyles } from "@material-ui/core/styles";

import { connect } from 'react-redux'
import {Switch, Route, withRouter,Redirect} from 'react-router-dom';

// ACTIONS
import {removeError} from '../store/actions/errors'
import { authUser } from '../store/actions/auth';

// COMPONENTS
// import Homepage from '../components/Homepage';
import AuthForm from '../components/AuthForm';
import HomeMain from './Home/HomeMain';
import PatientsMain from "./Patients/PatientsMain";

//Para que todas las Routes entren en el grid.
const styles = theme => ({
toolbar: {
    display: "flex",
    alignItems: "center",
    justifyContent: "flex-middle",
    padding: "0 8px",
    ...theme.mixins.toolbar
  },
  content: {
    flexGrow: 1,
    padding: theme.spacing.unit * 3
  },
  })

const Dashboard = props => {
  const { classes, theme } = props;
  const { authUser, errors, removeError, currentUser } = props;
  console.log(currentUser);

  return (
      <div>
        <Switch>
          <Route 
            exact 
            path="/" 
            render={props => ( <Redirect to='/home' /> )}
          />
          <Route 
            exact 
            path="/inicio" 
            render={props => {
              return (
                <HomeMain />
              );
            }}
          />
          <Route 
            exact 
            path="/pacientes" 
            render={props => {
              return(
                <PatientsMain />
              );
            }}
          />
{/*=========== AUTH FORMS SOLO PARA DEVELOPMENT, VAN EN LANDING ==========*/}
            { /*Acceso a Homepage, como referencia*/ }
            { /*<Homepage currentUser={currentUser} {...props} />*/ }

          <Route 
            exact 
            path="/login" 
            render={props => {
              return(
                <AuthForm removeError={removeError} errors={errors} onAuth={authUser} buttonText="Inicia Sesión" heading="Welcome Back." {...props} />
              );
            }}
          />
          <Route 
            exact 
            path="/signup" 
            render={props => {
              return(
                <AuthForm removeError={removeError} errors={errors} onAuth={authUser} signUp buttonText="Registro" heading="Únete a Nutric.io" {...props} />
              );
            }}
          />
{/*=========== AUTH FORMS SOLO PARA DEVELOPMENT, VAN EN LANDING ==========*/}
        </Switch>
      </div>
    )
}

function mapStateToProps(state) {
  return {
    currentUser: state.currentUser,
    errors:state.errors
  }
}

Dashboard.propTypes = {
  classes: PropTypes.object.isRequired,
  theme: PropTypes.object.isRequired
};

export default withRouter(connect(mapStateToProps,{ authUser, removeError })(Dashboard))
